const API_URL = 'https://taylorswiftapi.herokuapp.com/get';

function App() {
  return <div class="container">
    <div>
      This is where we're going to have the question.
    </div>
    <div>
      <div>Answer 1</div>
      <div>Answer 2</div>
      <div>Answer 3</div>
      <div>Answer 4</div>
    </div>
  </div>;
}

export default App;
